function showarr(array){
    var temp=``;
    array.forEach(function(elem,index){
        temp+=`<div id="first">
        <div id="img">
            <img src="${elem.img}" alt="">
        </div>
        <h3>${elem.category}</h3>
        <h3>${elem.brand}</h3>
        <h3>${elem.price}</h3>
        <button  id="${elem.value}">Add To Cart</button>
    </div>`
    })
    document.querySelector('#cntnt').innerHTML=temp;

}

function showcart(array){
    var temp=``;
    arr9.forEach(function(elem,index){
        temp+=`<div id="cartcntnt">
            <div id="cartimg">
            <img src="${elem.img}" alt="">
        </div>
        <div id="cartprdct">
            <h2>${elem.category}</h2>
            <h3>${elem.brand}</h3>
            <h3>$${elem.price}
            </h3>
        </div>
        <div id="cartbut">
            <button class="quant" id="${index}">quantity<span> ${count}</span> </button>
            <i data-key="${index}" id="add" class="ri-add-line"></i>
            <i  data-key="${index}"  id="sub" class="ri-subtract-line"></i>
            <button id="${index}">remove</button>
        </div> 
    </div>`
    }) 

    temp+=`<div id="cartfoot">
    <h2>Payment Details</h2> 
    <div class="line"></div>
    <div class="pay">
        <h3>Bag total</h3>
        <h3>$${grandtotal()}</h3>
    </div>
    <div class="pay">
        <h3>Discount Total</h3>
        <h3>+ 20%</h3>
    </div>
    <div class="pay">
        <h3>Shipping Charges</h3>
        <h3>+  $50</h3>
    </div>
    <div class="pay">
        <h3>Grand total</h3>
        <h3>$${(30*(grandtotal()))/100+(50)}</h3>
    </div>
</div>`
    document.querySelector('#cartshowcnt').innerHTML=temp;
}

function filter(){
    document.querySelector('#lip').addEventListener('click',function(dets){
        console.log(dets.target.id)
        arr1=arr.filter(function(elem){
            return elem.category==="Lipsticks"
        })
        showarr(arr1)
    })

    document.querySelector('#mass').addEventListener('click',function(dets){
        // console.log(dets.target.dataset)
        arr2=arr.filter(function(elem){
            return elem.category==="Mascara"
        })
        showarr(arr2)
    })

    document.querySelector('#skin').addEventListener('click',function(dets){
        // console.log(dets.target.dataset)
        arr3=arr.filter(function(elem){
            return elem.category==="Skin Care"
        })
        showarr(arr3)
    })

    document.querySelector('#eye').addEventListener('click',function(dets){
        // console.log(dets.target.dataset)
        arr4=arr.filter(function(elem){
            return elem.category==="Eye Makeup"
        })
        showarr(arr4)
    })

    document.querySelector('#acces').addEventListener('click',function(dets){
        // console.log(dets.target.dataset)
        console.log('hey')
        arr5=arr.filter(function(elem){
            return elem.category==="Accessories"
        })
        showarr(arr5)
    })
}

function search_by_category(){
    document.querySelector('#search').addEventListener('keypress',function(dets){
        // console.log(document.querySelector('#search').value)
        var searchval=document.querySelector('#search').value
        arr6=arr.filter(function(elem){
            return elem.category.toLowerCase().indexOf(searchval.toLowerCase())!==-1?true:false;
        })
        showarr(arr6)
    })
}

function search_by_brand(){
    document.querySelector('#search').addEventListener('keypress',function(dets){
        // console.log(document.querySelector('#search').value)
        var searchval=document.querySelector('#search').value
        arr7=arr.filter(function(elem){
            return elem.brand.toLowerCase().indexOf(searchval.toLowerCase())!==-1?true:false;
        })
        showarr(arr7)
    })
}

function displaycart(){
    document.querySelector('#cart').addEventListener('click',function(){
        document.querySelector('#showcart').style.display="initial";
    })

    document.querySelector('#arrow').addEventListener('click',function(){
        document.querySelector('#showcart').style.display="none";
    })
}

function carvalue(){
    if(localStorage.getItem('item')===null){
        document.querySelector('span').innerHTML=0;
    }
    else{
        realdata=backtovar();
        document.querySelector('span').innerHTML=realdata;
    }
}

function removecartitem(){
    document.querySelector('#cartshowcnt').addEventListener('click',function(dets){
        
        if(dets.target.innerHTML==='remove'){
            delete arr9[dets.target.id];
            showcart(arr9)
        }
    })
}

function quantfunc(){
    document.querySelector('#cartshowcnt').addEventListener('click',function(dets){
        console.log(dets.target);
        console.log(dets.target.dataset.key)
    if(dets.target.id==="add"){
            // console.log(arr9[dets.target.dataset.key].count++)
            count++;
            arr9[dets.target.dataset.key].price*=count;
            // console.log(arr9[dets.target.dataset.key].price*=count)
            showcart(arr9);
            // return count;
       }
    else if(dets.target.id==="sub"){
           if(count>1){
                count--;
                arr9[dets.target.dataset.key].price/=count;
                showcart(arr9);
                // return count;
           }
        }
        
    })
//    return count;
}

function grandtotal(){
    var grand=0;
    arr9.forEach(function(elem){
        grand+=elem.price;
        // console.log(grand);
    })
    return grand;
}


function cartdatafilter(id){
    arr9=arr9.concat(arr.filter(function(elem){
        return elem.value===id;
    }))
    // arr9.forEach(function(elem){
    //     elem.count=quantfunc();
    // })
    console.log(arr9);
    showcart(arr9);
}

