function cartincr(){
    document.querySelector('#cntnt').addEventListener('click',function(dets){
        // checkrepeatedelem_incart();
        cartdatafilter(dets.target.id)
        // console.log(dets.target.id)
        if(realdata==0){
            realdata++;
            converttostring(realdata);
            carvalue();
        }
        
        else{
            var item=backtovar();
            item++;
            converttostring(item)
            carvalue();
        }
    })
    document.querySelector('span').innerHTML=realdata;
}

function converttostring(int){
    var str=JSON.stringify(int);
    localStorage.setItem('item',str);
}

function backtovar(){
    var realdata=localStorage.getItem('item')
    return JSON.parse(realdata);
}

